window.bookSummaryJSON = "<p><i>New York Times</i> best-selling author Penelope Sky pens another dark and suspenseful masterpiece.</p> <p>I see his wicked smile in the theatre. I see it in the apartment across from mine.</p> <p>I see it everywhere.</p> <p>Before I can run, I'm taken.</p> <p>And when I wake up...I'm in the middle of nowhere.</p> <p>The man who's taken me claims to be a demon.</p> <p>And claims I'm his angel.</p> <p>What happens when he finds out I don't have wings?</p> <p>I'm not the only prisoner in this forest. There's a little girl too. Her name is Claire. She's beautiful, happy, wonderful. It's my responsibility to protect her--and I will give my life to accomplish that.</p> <p>She says her father will save us both.</p> <p>She says he's powerful, formidable, that he'll burn this entire forest to get to her.</p> <p>I hope she's right.</p> <p>Claire is unharmed throughout this story. There is no violence against children of any kind.</p>"; 
